import React from 'react';


function NextPage (props) {
  return (
    <div>
    Your promises: {props.promise}
    On: {props.date}
    At: {props.time}
    Where: {props.place}
    Phone-number you have entered: {props.phone}
    </div>
  )
}


export default NextPage;
